import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="container">
        <h1 className="display-4 text-dark text-center">React Counter</h1>
        <div className="counterContent"></div>
      </div>
    </div>
  );
}

export default App;
